import com\.fasterxml\.jackson\.core\.JsonProcessingException\;
import com\.fasterxml\.jackson\.databind\.JsonMappingException\;
import com\.fasterxml\.jackson\.databind\.ObjectMapper\;

public class JSONUtils \{
\ private static DateFormat shortDateFormat \= new SimpleDateFormat\(DateUtils\.SHORT_DATE\)\;
\ private static DateFormat longDateFormat \= new SimpleDateFormat\(DateUtils\.LONG_DATE\)\;
\ private static ObjectMapper objectMapper \= new ObjectMapper\(\)\;

\ public static String obj2Json\(Object obj\) \{
\ \ String jsonStr \= ""\;
\ \ try \{
\ \ \ objectMapper\.setDateFormat\(longDateFormat\)\;
\ \ \ jsonStr \= objectMapper\.writeValueAsString\(obj\)\;
\ \ \} catch \(JsonProcessingException e\) \{
\ \ \ e\.printStackTrace\(\)\;
\ \ \}
\ \ return jsonStr\;
\ \}
\ 
\ public static \<T\> T json2Obj\(String jsonStr\, Class\<T\> clazz\) throws JsonParseException\, JsonMappingException\, IOException\{
\ \ T t \= objectMapper\.readValue\(jsonStr\.toString\(\)\, clazz\)\;
\ \ return t\;
\ \}
\ 
\ \@SuppressWarnings\("unchecked"\)
\ public static Map\<String\,Object\> json2Map\(String json\)\{
\ \ Map\<String\, Object\> map \= null\;
\ \ 
\ \ try \{
