\ \ \} catch \(JsonParseException e\) \{
\ \ \ e\.printStackTrace\(\)\;
\ \ \} catch \(JsonMappingException e\) \{
\ \ \ e\.printStackTrace\(\)\;
\ \ \} catch \(IOException e\) \{
\ \ \ e\.printStackTrace\(\)\;
\ \ \}
\ \ 
\ \ 
\ \ return map\;
\ \}
